import AdminHeader from "./adminheader";
import Header from "./header";

function AdminPage() {
  return (
    <div>
      <AdminHeader />
      <h3 className="d-flex justify-content-center align-items-center">
        User Profile
      </h3>
      <br></br>
    </div>
  );
}
export default AdminPage;
